import GlobalStyle from '../../styles/global';
import { useObserver } from 'mobx-react';

const Layout = ({ children }) => <div className="layout">{children}</div>

export default function App({ Component, pageProps }) {
  return useObserver(() => {
    return (
      <>
        <GlobalStyle />
        <Layout>
          <Component {...pageProps} />
        </Layout>
      </>
    )
  });
}
